	add("dichotomy", "{\"term\":\"dichotomy\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"From Ancient greek (to 1453) \u0027διχότομος\u0027 (equally divided, cut in half)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A separation or division into two; a distinction that results in such a division\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1989\u0027\u0027, Carole Pateman, \u00276: Feminist Critiques of the Public/Private \u0027\u0027Dichotomy\u0027\u0027\u0027, \u0027The Disorder of Women: Democracy, Feminism, and Political Theory\u0027, [http://books.google.com.au/books?id\u003dVlq73L-2T2oC\u0026amp;pg\u003dPA118\u0026amp;dq\u003d%22dichotomy%22%7C%22dichotomies%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dYZolUbffHdHPkAWpjoGABQ\u0026amp;redir_esc\u003dy page 118\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027dichotomy\u0027\u0027 between the private and the public is central to almost two centuries of feminist writing and political struggle; it is, ultimately, what the feminist movement is all about. Although some feminists treat the \u0027\u0027dichotomy\u0027\u0027 as a universal, trans-historical and trans-cultural feature of human existence, feminist criticism is primarily directed at the separation and opposition between the public and private spheres in liberal theory and practice\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2003\u0027\u0027, Thérèse Encrenaz \u0027et al\u0027., Storm Dunlop (translator), \u0027The Solar System\u0027 [\u0027Système Solaire\u0027], [http://books.google.com.au/books?id\u003dJe61Y7UbqWgC\u0026amp;pg\u003dPA232\u0026amp;dq\u003d%22dichotomy%22%7C%22dichotomies%22+moon\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dmuolUYe-JcmokAW1yoCQAg\u0026amp;redir_esc\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22dichotomy%22%7C%22dichotomies%22%20moon\u0026amp;f\u003dfalse page 232\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027dichotomy\u0027\u0027 between maria and highlands dominates lunar mineralogy\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"2005\u0027\u0027, S. P. Naidu, \u0027Public Administration: Concepts And Theories\u0027, [http://books.google.com.au/books?id\u003dGWrZhzdhPfoC\u0026amp;pg\u003dPA55\u0026amp;dq\u003d%22dichotomy%22%7C%22dichotomies%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dYZolUbffHdHPkAWpjoGABQ\u0026amp;redir_esc\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22dichotomy%22%7C%22dichotomies%22\u0026amp;f\u003dfalse page 55\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"Despite some contradictions found in the essay, its major emphasis is laid on the politics-administration \u0027\u0027dichotomy\u0027\u0027 theory. It is largely devoted to the argument concerning the separability of politics and administration. The politics-administration \u0027\u0027dichotomy\u0027\u0027 initiated by Wilson was later elaborated by Frank J. Goodnow in his work, “Politics and Administration” (1900\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"2008\u0027\u0027, N. Gregory Mankiw, \u0027Principles of Economics\u0027, 6th Edition, [http://books.google.com.au/books?id\u003dnZE_wPg4Wi0C\u0026amp;pg\u003dPA723\u0026amp;dq\u003d%22dichotomy%22%7C%22dichotomies%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dYZolUbffHdHPkAWpjoGABQ\u0026amp;redir_esc\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22dichotomy%22%7C%22dichotomies%22\u0026amp;f\u003dfalse page 723\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"All of this previous analysis was based on two related ideas: the classical \u0027\u0027dichotomy\u0027\u0027 and monetary neutrality. Recall that the classical \u0027\u0027dichotomy\u0027\u0027 is the separation of variables into real variables (those that measure quantities or relative prices) and nominal variables (those measured in terms of money\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"Such a division involving apparently incompatible or opposite principles; a duality\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"The division of a class into two disjoint subclasses that are together comprehensive, as the division of \u0027man\u0027 into \u0027white\u0027 and \u0027not white\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"2011\u0027\u0027, Patrick J. Hurley, \u0027A Concise Introduction to Logic\u0027, [http://books.google.com.au/books?id\u003dIkp2dGWT5O4C\u0026amp;pg\u003dPT186\u0026amp;dq\u003d%22dichotomy%22%7C%22dichotomies%22+logic\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dNr8lUez8MIPGkAWnxwE\u0026amp;redir_esc\u003dy page 162\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"But in the fallacy of false \u0027\u0027dichotomy\u0027\u0027, not only do the two alternatives fail to be jointly exhaustive, but they are not even likely. As a result, the disjunctive premise is false, or at least probably false\", \"priority\":16},{\"upperType\":\"NOUN\", \"text\":\"2011\u0027\u0027, Tomasz A. Gorarzd, Jacek Krzaczkowski, \u0027The Complexity of Problems Connected with Two-Element Algebras\u0027, Paweł M. Idziak, AndrzejWronski, \u0027Reports on Mathematical Logic: No. 46\u0027, [http://books.google.com.au/books?id\u003dP9kyIirVVxUC\u0026amp;pg\u003dPA92\u0026amp;dq\u003d%22dichotomy%22%7C%22dichotomies%22+logic\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dNr8lUez8MIPGkAWnxwE\u0026amp;redir_esc\", \"priority\":17},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22dichotomy%22%7C%22dichotomies%22%20logic\u0026amp;f\u003dfalse page 92\", \"priority\":18},{\"upperType\":\"NOUN\", \"text\":\"One can ask if for any algebra the considered problem is always in P or NP-complete (P or coNP-complete)? For example, the problem of the satisfiability of a system of polynomial equations over a group G is in P if G is abelian and NP-complete otherwise ([7, 13\", \"priority\":19},{\"upperType\":\"NOUN\", \"text\":\"One of the most widely known subclasses of NP which exhibits such a \u0027\u0027dichotomy\u0027\u0027, is the class of constraint satisfaction problems (CSP) on the set {0,1}, see [16]. Recently Bulatov proved the \u0027\u0027dichotomy\u0027\u0027 for CSP on a three-element set [3\", \"priority\":20},{\"upperType\":\"NOUN\", \"text\":\"The division of a genus into two species; a division into two subordinate parts\", \"priority\":21},{\"upperType\":\"NOUN\", \"text\":\"A phase of the moon when it appears half lit and half dark, as at the quadratures\", \"priority\":22},{\"upperType\":\"NOUN\", \"text\":\"1854\u0027\u0027, Edward Greswell, \u0027Origines Kalendariæ Italicæ: Tables of the Roman Calendar\u0027, Volume 1, [http://books.google.com.au/books?id\u003dJ54NAAAAQAAJ\u0026amp;pg\u003dPA261\u0026amp;dq\u003d%22dichotomy%22%7C%22dichotomies%22+moon\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dmuolUYe-JcmokAW1yoCQAg\u0026amp;redir_esc\", \"priority\":23},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22dichotomy%22%7C%22dichotomies%22%20moon\u0026amp;f\u003dfalse page 261\", \"priority\":24},{\"upperType\":\"NOUN\", \"text\":\"The Ides of Januarius indeed, the preceding month, must have fallen on March 1 at midnight, two days before the first \u0027\u0027dichotomy\u0027\u0027 of the mean new moon of that month, March 3 at midnight\", \"priority\":25},{\"upperType\":\"NOUN\", \"text\":\"Successive division and subdivision; successive bifurcation, as of a stem of a plant or a vein of the body into two parts as it proceeds from its origin\", \"priority\":26},{\"upperType\":\"NOUN\", \"text\":\"A fork (bifurcation) in a stem or vein\", \"priority\":27},{\"upperType\":\"NOUN\", \"text\":\"1969\u0027\u0027, J. F. Rigby, \u0027Permian Sphenopsids from Antarctica\u0027, \u0027Geological Survey Professional Paper 613-F\u0027, [http://books.google.com.au/books?id\u003dnYFXAAAAMAAJ\u0026amp;pg\u003dSL6-PA9\u0026amp;dq\u003d%22dichotomy%22%7C%22dichotomies%22+vein%7Cstem\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dn9olUeDPJI-ZlQXQpIDQCw\u0026amp;redir_esc\", \"priority\":28},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22dichotomy%22%7C%22dichotomies%22%20vein%7Cstem\u0026amp;f\u003dfalse page F-9\", \"priority\":29},{\"upperType\":\"NOUN\", \"text\":\"In one forked leaf there is a distinct vein \u0027\u0027dichotomy\u0027\u0027, and the leaf boundary commences 1.5 mm above the \u0027\u0027dichotomy\", \"priority\":30},{\"upperType\":\"NOUN\", \"text\":\"2010\u0027\u0027, V. Singh, P. C. Pande, D. K. Jain, \u0027Text Book Of Botany: Diversity Of Microbes And Cryptogams\u0027, 4th Edition, [http://books.google.com.au/books?id\u003dv3UCVxNYVwkC\u0026amp;pg\u003dPA511\u0026amp;dq\u003d%22dichotomy%22%7C%22dichotomies%22+vein%7Cstem\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dn9olUeDPJI-ZlQXQpIDQCw\u0026amp;redir_esc\", \"priority\":31},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22dichotomy%22%7C%22dichotomies%22%20vein%7Cstem\u0026amp;f\u003dfalse page 511\", \"priority\":32},{\"upperType\":\"NOUN\", \"text\":\"In most of the creeping species with dorsiventral stems (e.g., \u0027S. kraussiana\u0027, \u0027S. laevigata\u0027) roots arise at or close to the point of \u0027\u0027dichotomy\u0027\u0027; in species like \u0027S. rupestris\u0027 and \u0027S. wallichii\u0027 they arise at the point of \u0027\u0027dichotomy\u0027\u0027 as well as other positions and in \u0027S. selaginoides\u0027 and \u0027S. spinulosa\u0027 they arise from knot like swellings present at the basal portion of the stem\", \"priority\":33}]}, \"synonyms\":{}}");

