	add("dictation", "{\"term\":\"dictation\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\"], \"text\":\"From \u0027dictātiō\u0027 noun of action from \u0027dictātus\u0027 the perfect passive participle of \u0027dictō\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Dictating, the process of speaking for someone else to write down the word\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Since I learned shorthand, I can take \u0027\u0027dictation\u0027\u0027 at eighty words a minute\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"An activity in school where the teacher reads a passage aloud and the students write it dow\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1908:\u0027\u0027 Lucy Maud Montgomery, \u0027Anne of Green Gables\u0027 - We had reading and geography and Canadian history and dictation today\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The act of ordering or commandin\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"1852:\u0027\u0027 Lysander Spooner, \u0027An Essay on the Trial by Jury\u0027 - ...jurors in England have formerly understood it to be their right and duty to judge only according to their consciences, and not to submit to any \u0027\u0027dictation\u0027\u0027 from the court, either as to law or fact\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Orders given in an overbearing manne\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"His habit, even with friends, was that of \u0027\u0027dictation\", \"priority\":8}]}, \"synonyms\":{}}");

	add("dictator", "{\"term\":\"dictator\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Latin\"], \"text\":\"From Latin {{m|la|dictātor||a chief magistrate}}, from {{m|la|dictō||dictate, prescribe}}, from {{m|la|dīcō||say, speak}}.Surface analysis is {{suffix|dictate|or|t2\u003d(agent)|lang\u003den}} “one who dictates”.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Originally, a magistrate without colleague in republican ancient Rome, who held full executive authority for a term granted by the senate (legislature), typically to conduct a wa\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A totalitarian leader of a country, nation, or governmen\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A tyrannical boss, or authority figur\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A person who dictates text (e.g. letters to a clerk\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A ruler or Führer, the highest level of authority\", \"priority\":5}]}, \"synonyms\":{}}");

