	add("dictionary", "{\"term\":\"dictionary\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Latin\"], \"text\":\"{{m|la|dictionarium}}, from Latin {{m|la|dictionarius}}, from {{m|la|dictio||speaking}}, from {{m|la|dictus}}, perfect past participle of {{m|la|dīcō||speak}} + {{m|la|-arium||room, place}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A reference work with a list of words from one or more languages, normally ordered alphabetically and explaining each word\u0027s meaning and sometimes containing information on its etymology, usage, translations and other data\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"But what other kind(s) of syntactic information should be included in Lexical Entries? Traditional \u0027\u0027dictionaries\u0027\u0027 such as Hornby\u0027s (1974) \u0027Oxford Advanced Learner\u0027s \u0027\u0027Dictionary\u0027\u0027 of Current English\u0027 include not only \u0027categorial\u0027 information in their entries, but also information about the range of \u0027Complements\u0027 which a given item permits (this information is represented by the use of a number/letter code\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"By extension, any work that has a list of material organized alphabetically; e.g. biographical dictionary, encyclopedic dictionary\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"An associative array, a data structure where each value is referenced by a particular key, analogous to words and definitions in a physical dictionary\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"2011\u0027\u0027, Jon Galloway, Phil Haack, Brad Wilson, \u0027Professional ASP.NET MVC 3\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"User calls \u0026lt;code\u0026gt;RouteCollection.GetVirtualPath\u0026lt;/code\u0026gt;, passing in a \u0026lt;code\u0026gt;RequestContext\u0026lt;/code\u0026gt;, a \u0027\u0027dictionary\u0027\u0027 of values, and an optional route name used to select the correct route to generate the URL\", \"priority\":6}]}, \"synonyms\":{}}");

